import React from 'react';
import './App.css';
import { Switch, Route } from "react-router-dom";
import HomePage from './views/homePage/HomePage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Switch>
          <Route exact path="/" component={HomePage} />
        </Switch>
      </header>
    </div>
  );
}

export default App;
